import React from 'react'
import {Link} from 'react-router-dom'
const DisplayStudentDetails = (props) => {
    const {id} = props
    return (
        <div>
            <Link to ={`/students/${id}`}>
                <button>details</button>
            </Link>
        </div>
    )
}

export default DisplayStudentDetails
